import React from 'react';
import { Navbar, Nav, Container, NavDropdown } from 'react-bootstrap';

import { Link } from 'react-router-dom';

function CustomNavbar({ stickyClass, navbarOpacity }) {
  return (
    <Navbar expand="lg" className={`w-100 ${stickyClass || 'position-absolute'}`} style={{ opacity: navbarOpacity }}>
      <Container>
        <Navbar.Toggle aria-controls='basic-navbar-nav' />
        <Navbar.Collapse id='basic-navbar-nav'>
          <Nav className='me-auto justify-content-center w-100'>
            <Nav.Link as={Link} to='/' className='text-uppercase'>Home</Nav.Link>
            <Nav.Link as={Link} to='/about' className='text-uppercase'>About us</Nav.Link>
            <Nav.Link as={Link} to='/blog' className='text-uppercase'>Blog</Nav.Link>
            <Nav.Link as={Link} to='/contact' className='text-uppercase'>Get in touch</Nav.Link>

            <NavDropdown title="Faculties" id="faculties-dropdown" className='text-uppercase'>
            <NavDropdown.Item as={Link} to='/focm'>Engineering</NavDropdown.Item>
            <NavDropdown title="FEECE" id="feece-dropdown">
            <NavDropdown.Item as={Link} to='/feece'>FEECE Main</NavDropdown.Item>
            <NavDropdown.Item as={Link} to='/feece/computer-systems'>Computer Systems</NavDropdown.Item>
            <NavDropdown.Item as={Link} to='/feece/software'>Software Engineering</NavDropdown.Item>
  </NavDropdown>

</NavDropdown>
          </Nav>
        </Navbar.Collapse>
      </Container>
    </Navbar>
  );
}

export default CustomNavbar;
